import Landing from './components/Landing'
import Navbar from './components/Navbar'

import React from 'react'
import { Route, Switch } from 'react-router-dom'

function App() { 
  return (
    <main>
      <Navbar/>
      <Switch>
        <Route path="/" component={Landing} exact />
      </Switch>
      </main>
  );
}

export default App;
